import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
    return (
        <>
            <div className = "menu">
                <NavLink className = {linkStyle} exact activeClassName="styleMenu" to="/home">Home</NavLink>
                <NavLink exact activeClassName="styleMenu" to="/name/Tarun">User</NavLink>
                <NavLink exact activeClassName="styleMenu" to="/service">Service</NavLink>
                <NavLink exact activeClassName="styleMenu" to="/contact">Contact</NavLink>
            </div>
        </>
    );
}

export default Menu;
